import React, { useState, useEffect } from "react";
import { Route, Routes } from "react-router-dom";
import "./App.css";

function App() {
  const [data, setData] = useState(null);

  useEffect(() => {
    fetch("/home")
      .then((res) => res.json())
      .then((res) => setData(res.message));
  });
  return (
    <div className="App">
      <header className="App-header">
        <p>{!data ? "Loading.." : data}</p>
      </header>
    </div>
  );
}

export default App;
